    "import numpy as np\n",
    "\n",
    "def rgb_a_bit(imagen):\n",
    "    '''Convierte los pixeles de base \n",
    "    decimal (de 0 a 255) a binaria \n",
    "    (de 00000000 a 11111111).\n",
    "\n",
    "    :param imagen: array de una imagen \n",
    "    :return: Un vector de (1 x k) bits 'int'\n",
